import './App.css';

import { Home } from './Home';
import { Restoranti } from './Restoranti';
import Navigation from '.'
import { Qyteti } from './Qyteti';

import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Navigation />
        <div className="content">
          <Switch>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/restoranti">
              <Restoranti />
            </Route>
            <Route path="/qyteti">
              <Qyteti />
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
